import { combineReducers } from "redux";
import reducer from "./reducer";
import mstreducer from "./mstreducer";
import guesses from "./guessreducer";

const reducers = combineReducers({
  player: reducer,
  misstakes: mstreducer,
  guessed: guesses,
});

export default reducers;
